import React from 'react';
import twitterImg from '../../assets/img/twitter.png'

function Twitter() {
    return (
        <a href="https://twitter.com/becketbowes/status/395971206731419648?s=20&t=L0pTsZ2aTMmJ0kH5C9mXmg" target="blank">
            <img src={twitterImg} alt="find me on twitter" />
        </a>
    )
};

export default Twitter;
